import React from 'react';

function Employeetable(props) {
    console.log(props);
    props.employee.map(({ login, name, picture, email, cell, dob}))
    return(
    
        <tbody>
            <tr>
                <td data-th="Name">
                    <p></p>
                </td>
            </tr>

        </tbody>
    
    )
}

export default Employeetable;
